{'id': 18386534, 'body': "If the app was for some reasons locked again on the same device (after reinstallation, update etc.), it's very easy to unlock it again. 
You can try going to the Parents section in the app and tapping on the Restore button.  Please make sure that you disbale all parental control first. We never had any issues with it.


